import React from 'react'

export default function BookItem(props) {
  return (
      <tr className="individual-book">
            <td>Serial Number</td>
            <td>Name</td>
            <td>Author</td>
            <td>Genre</td>
            <td>Pirate Link</td>
    </tr>
  )
}
